import React from 'react';
import Dashboard from './Dashboard'
import Reviews from './Reviews'
import Rating from './Rating'
import Analysis from './Analysis'


function App() {
  return (
    <div id="root">
      <Dashboard />
      <Reviews />
      <Rating />
      <Analysis />
    </div>
  );
}

export default App;
